import React from 'react';
import './Navbar.css';

import Logo from '../images/logo.png'

function Nav() {
  return (
    <div className=''>
        <div className='navbar'>
        
           <ul>
            <li>Home</li>
            <li>Kids</li>
            <li>Tech</li>
            <li>Food</li>
            <li>Resturant</li>
            </ul> 
            <a href="/Home" ><img src={Logo} className='logo-image'/></a>
            
        </div>
        
        
    </div>
  );
}

export default Nav;
